import Home from "../pages/home";
import AboutUs from "../pages/aboutUs";
import ContactUs from "../pages/contactUs";
import HowItWorks from "../pages/howItWorks";
import OurProjects from "../pages/ourProjects";

const MENU = ["Home", "How it works", "Our projects", "About us", " Contact us"];

const PAGES = [
  {
    component: Home,
    styles:{
      height: "100vh",
      backgroundColor: "#155C1D",
      color: "#FFFFFF",
    }
  },
  {
    component: AboutUs,
    styles:{
      height: "100vh",
      backgroundColor: "#D4DF3C",
      color: "#FFFFFF",
    }
  },
  {
    component: ContactUs,
    styles:{
      height: "100vh",
      backgroundColor: "#4F9646",
      color: "#FFFFFF",
    }
  },
  {
    component: HowItWorks,
    styles:{
      height: "100vh",
      backgroundColor: "#0E5518",
      color: "#FFFFFF",
    }
  },
  {
    component: OurProjects,
    styles:{
      height: "100vh",
      backgroundColor: "#90B232",
      color: "#FFFFFF",
    }
  }
] 

export {MENU, PAGES};
